E_D("replace into `phome_ecms_game` values('618','5','0','','','','1','admin','','1','0','1343189288','0','0','0','0','','','618','0','0','0','0','0','0','三个和尚','1343189288','/spic/20120725/204.jpg','0','1','1343189288','0','3','1','0','','0','','','667','479','《三个和尚》动画片是根据中国民间谚语改编而成的，通过三个和尚没水吃、寺庙失火、三个和尚齐心协力救火直至后来三人合作吊水的情节，既批评了“三个和尚没水吃”这种社会上存在的落后思想，又提倡了“人心齐，泰山移”的社会新风尚，与现实生活紧密。该片获得了丹麦第四届欧登国际童话影展银质奖、第三十二届柏林国际电影节银熊奖、葡萄牙国际国片电影节最佳影片奖、第一届中国电影“金鸡奖”最佳美术片奖.....','1','','0','','1','/dpic/20120725/205.jpg','463','/donghuapian/463/1.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/05/0107.jpg','http://www.61baobao.com/donghuapian/pic/05/0107.jpg','0','三个月以上','1','cntv,6373F334FEF24505B86BAADEE5E4B54F|||','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('619','5','0','','','','1','admin','','1','0','1343189290','0','0','0','0','','','619','0','0','0','0','0','0','动物总动员','1343189290','/spic/20120725/211.jpg','0','1','1343189290','0','3','1','0','','0','','','667','479','　广袤无际的非洲大草原上，饱受干旱所侵扰的动物们耐心却又焦灼地等待着洪水的到来。今年的汛期似乎姗姗来迟，动物们心中满是不安。他们无论如何也不会想到，不远处的峡谷间耸起一座大坝，人类用它拦截了本该滋润草原和万物的水源。 　　与此同时，草原上迎来了几名罕见的来客：孤独的北极熊、聒噪的高卢鸡、相伴上百年沧桑岁月的乌龟夫妇、活泼的袋鼠以及爱放臭屁的笑笑。他们都是因为人类的颟顸与无知，而被迫离开赖以栖息的家园，只为寻找一个没有人类足迹的乐土。只是非洲草原的情况也不容乐观，来自异乡的动物们不得不和当地的动物朋友联合起来，踏上寻找水源的惊险之旅……','1','','0','','1','/dpic/20120725/212.jpg','232','/donghuapian/232/1.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/06/049.jpg','http://www.61baobao.com/donghuapian/pic/06/049.jpg','0','三个月以上','1','sohu,385489|||','0','','0','0','0');");
