E_D("replace into `phome_ecms_game` values('633','5','0','','','','1','admin','|43|','1','0','1343189338','0','0','0','0','','','633','0','0','0','0','0','0','霹雳贝贝','1343189338','/spic/20120725/261.jpg','0','1','1343972844','0','3','1','0','','1','','','667','479','    一个宁静的夜晚，城市上空突然出现了一个飞行物，它鸣叫着并放出奇异的光彩。医院里，手术室的灯灭了，一会儿，一个小生命来到这个世界，时针正指九点。孩子取名贝贝。出院那天，爸爸来接他，不料，爸爸、妈妈都被他电了一下。贝贝带电的事，爷爷不让说出去怕别人把他当怪物。贝贝6岁了，还被关在家里不让出门，并整天戴着一副红手套。','1','','0','','1','/dpic/20120725/262.jpg','246','/donghuapian/246/1.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/152.jpg','http://www.61baobao.com/donghuapian/pic/152.jpg','0','三个月以上','1','youku,23974189|||','0','','0','0','0');");
