E_D("replace into `phome_ecms_game` values('640','5','0','','','','1','admin','','1','0','1343189346','0','0','0','0','','','640','0','0','0','0','0','0','福五鼠之三十六计','1343189346','/spic/20120725/247.jpg','0','1','1343189346','0','3','1','0','','0','','','667','479','　　在一个奇妙的世界里，有三个王国，老鼠王国、猫王国和狗王国。一位新上任的猫王为了满足自己的私欲向狗王谗媚，利用狗国的强势将鼠国分遣到地质环境恶劣的布布岛。布布岛怪石嶙峋，土壤干涸，难以耕种，被人们称之为：步步倒——即行走与生活艰难，似乎多行一步就会倒下！鼠国处于这种环境无以为生，人民长期食不果腹，甚至连鼠王自己也常常面临缺粮的危机。一天，猫王带了大量粮食前来拜访，并附上一张“以万斤大米换取万民壮丁”的契约。鼠王面对诱人的粮食，忍耐不住饥饿，最终签署了条约。','1','','0','','1','/dpic/20120725/248.jpg','277','/donghuapian/277/1.html, /donghuapian/277/2.html, /donghuapian/277/3.html, /donghuapian/277/4.html, /donghuapian/277/5.html, /donghuapian/277/6.html, /donghuapian/277/7.html, /donghuapian/277/8.html, /donghuapian/277/9.html, /donghuapian/277/10.html, /donghuapian/277/11.html, /donghuapian/277/12.html, /donghuapian/277/13.html, /donghuapian/277/14.html, /donghuapian/277/15.html, /donghuapian/277/16.html, /donghuapian/277/17.html, /donghuapian/277/18.html, /donghuapian/277/19.html, /donghuapian/277/20.html, /donghuapian/277/21.html, /donghuapian/277/22.html, /donghuapian/277/23.html, /donghuapian/277/24.html, /donghuapian/277/25.html, /donghuapian/277/26.html, /donghuapian/277/27.html, /donghuapian/277/28.html, /donghuapian/277/29.html, /donghuapian/277/30.html, /donghuapian/277/31.html, /donghuapian/277/32.html, /donghuapian/277/33.html, /donghuapian/277/34.html, /donghuapian/277/35.html, /donghuapian/277/36.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/06/094.jpg','http://www.61baobao.com/donghuapian/pic/06/094.jpg','0','三个月以上','36','qiyi,81239e9653df421997d316c628cf905c|||qiyi,650be1a2f36049c69b1dba08c8e29217|||qiyi,d925891db961435a844a13f981ada408|||qiyi,c2d6641edaca4632b36333eeb412cb06|||qiyi,516c9c4815074fe6be8ff945ed425a2a|||qiyi,4416b2574aa848e99be00485200f9323|||qiyi,82a1dfbd2af74d8a95d0f4eb12dbff91|||qiyi,7713e5fe522f4c7e853863d4db827912|||qiyi,377ae14e688c4d719350d3b0c129f8c1|||qiyi,ab0e935eba234ab78e9572