E_D("replace into `phome_ecms_game` values('645','5','0','','','','1','admin','','1','0','1343189358','0','0','0','0','','','645','0','0','0','0','0','0','拔萝卜','1343189358','/spic/20120725/249.jpg','0','1','1343189358','0','3','1','0','','0','','','667','479','    小白兔在地里找到一只大萝卜，用尽全身力气拔不出来。这时小猴来了，小兔请它一起拔，还是拔不动。小猴又从草丛里把正在睡懒觉的小猪喊醒，叫它一起拔。小猪没有睡醒，一边拔一边又睡着了。它们正在发愁，走来一只身材魁梧的小熊，它高傲自大，自以为力气大，把小兔、小猴、小猪一起赶开，独自去拔萝卜，想炫耀一番。结果萝卜没有拔出，自己却摔得瘫在地上，幸亏小猴帮它，才喘过气来。小熊接受了教训，和大家一起齐心合力拔萝卜。最后，连小小的蜗牛也赶来参加，终于把大萝卜拔了出来。','1','','0','','1','/dpic/20120725/250.jpg','294','/donghuapian/294/1.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/06/111.jpg','http://www.61baobao.com/donghuapian/pic/06/111.jpg','0','三个月以上','1','qiyi,d2ef345157884711bda04d5dea728cdf|||','0','','0','0','0');");
