E_D("replace into `phome_ecms_game` values('649','5','0','','','','1','admin','','1','0','1343189375','0','0','0','0','','','649','0','0','0','0','0','0','星达丘快乐学园','1343189375','/spic/20120725/283.jpg','0','1','1343189375','0','3','1','0','','0','','','667','479','明日村StarQ小学一年二班里有着一群快乐的小学生，小朋友们每天都开心的在校园里学习和嬉戏，每个小朋友都很聪明可爱，但又个性十足，他们中有热血的卷毛，骄傲的大牌，也有可人的薇薇，老实的阿牛，还有爱耍宝的吉吉米米兄弟，高谈阔论的怪卡等等，当然还有最最调皮捣蛋的星猫同学！每天校园里都会充满了欢声笑语，可是小朋友们之间往往也会因为一点小事而产生一些小小的故事，闹出了很多笑话哦。不过在校长，白教授和 Jenny 老师的教育 导下，小朋友们最后都知道了怎样做一个文明的人，怎样和同学和睦相处，于是校园里又再次充满了欢笑声。','1','','0','','1','/dpic/20120725/284.jpg','557','/donghuapian/557/1.html, /donghuapian/557/2.html, /donghuapian/557/3.html, /donghuapian/557/4.html, /donghuapian/557/5.html, /donghuapian/557/6.html, /donghuapian/557/7.html, /donghuapian/557/8.html, /donghuapian/557/9.html, /donghuapian/557/10.html, /donghuapian/557/11.html, /donghuapian/557/12.html, /donghuapian/557/13.html, /donghuapian/557/14.html, /donghuapian/557/15.html, /donghuapian/557/16.html, /donghuapian/557/17.html, /donghuapian/557/18.html, /donghuapian/557/19.html, /donghuapian/557/20.html, /donghuapian/557/21.html, /donghuapian/557/22.html, /donghuapian/557/23.html, /donghuapian/557/24.html, /donghuapian/557/25.html, /donghuapian/557/26.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/05/0171.jpg','http://www.61baobao.com/donghuapian/pic/05/0171.jpg','0','三个月以上','26','qiyi,90d0d70c4b074a64b4299519dfc6ffc4|||qiyi,0b675082663c49fd98225947b00c43d4|||qiyi,f25ef3ff0c6c4c41b7df4beb5f6b63be|||qiyi,5e03c88577d648739cf4ead111828361|||qiyi,3eeb82f069d84f98858dee27db2b3d6a|||qiyi,0f188572feb14616923336217188e516|||qiyi,0d7367f02b324b0c9d89f7b1809e37fd|||qiyi,fbf869186e7e4d2885ac9243a99dac99|||qiyi,50bf2a07bb1a43f483059af8da0c86c8|||qiyi,072d767b05cc4383aad67a39580b5d2d|||qiyi,e0be25f814ff450c9e8a58a5e15b276a|||qiyi,dc151a5ea3234650810e29ab285d43b6|||qiyi,9d0c7d97f5894795a8cfb54d8a40f9c5|||qiyi,1db01b86ef7448d6923db7271d4d3db7|||qiyi,d1033a1ddaf74335b1a01f6c6e9ee22e|||qiyi,515dd1d2833544