E_D("replace into `phome_ecms_game` values('650','5','0','','','','1','admin','','1','0','1343189375','0','0','0','0','','','650','0','0','0','0','0','0','猪八戒吃西瓜','1343189375','/spic/20120725/299.jpg','0','1','1343189375','0','3','1','0','','0','','','667','479','唐僧师徒四人去西天取经，途经荒山野地，唐僧派孙悟空去寻找瓜果食 品，猪八戒也要同去。两人没走多远 ，八戒就假装肚子痛，悟空只得独自前去。八戒刚要入睡，忽见前面山崖下有个大西瓜， 连忙把它搬到树荫下，切成四块。先把属于自己的一块吃了，但觉得不过瘾，便想了各种借口，相继把属于悟空、沙僧，以至师父的西瓜全吃了。为了教训八戒，悟空变成一块西瓜皮，一路跟随八戒回去。西瓜皮故意捉弄八戒， 使他摔了不少跟斗。最后，八戒只得在师父面前承认了自己的错误。','1','','0','','1','/dpic/20120725/300.jpg','603','/donghuapian/603/1.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/05/0217.jpg','http://www.61baobao.com/donghuapian/pic/05/0217.jpg','0','三个月以上','1','qiyi,a98ea540fdbf4f9f8cfbd5715ac9af98|||','0','','0','0','0');");
