E_D("replace into `phome_ecms_game` values('660','5','0','','','','1','admin','|42|','1','0','1343189399','0','0','0','0','','','660','0','0','0','0','0','0','101忠狗','1343189399','/spic/20120725/293.jpg','0','1','1343189399','0','3','1','0','','0','','','667','479','在伦敦，罗杰与安妮塔原是两个互不相识的陌生人，唯一的共同点是他们各自养了一条斑点狗，一天在伦敦的海德公园里，两只爱犬一见钟情，顺带把它们的主人也牵上了红线，分别组成了两个幸福的家庭，一窝可爱的小斑点狗很快降生了。然而天又不测之风云，恶毒的坏女人古莱拉突然出现，并偷走了它们的心爱宝贝。斑点狗彭哥和白佩蒂在众多热心的动物帮助下，经历种种困难，终于从古莱拉的魔掌中救出99只遭难的斑点狗。迪士尼第17部经典动画长片，根据儿童读物《101忠狗》改编而成，被认为是父母最乐意推荐给小朋友观赏的电影之一，迪士尼动画长片中相当受欢迎的一部。','1','','0','','1','/dpic/20120725/294.jpg','151','/donghuapian/151/1.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/143.jpg','http://www.61baobao.com/donghuapian/pic/143.jpg','0','三个月以上','1','sohu,4312|||','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('661','5','0','','','','1','admin','','1','0','1343189404','0','0','0','0','','','661','0','0','0','0','0','0','外星人小闹闹','1343189404','/spic/20120725/297.jpg','0','1','1343189404','0','3','1','0','','0','','','667','479','《外星人小闹闹》是舞之数码动画09年新开发的一部轻松搞笑的喜剧动画片，为舞之数码《努努多的暑假》续集。根据市场反响，提取了其中人气最高的三个配角，来自香菇星球的外星人唧唧、歪歪和小闹闹为主角，继续这三个小外星人在芒果镇的搞笑生活。从香菇星球来的唧唧、歪歪、小闹闹，原本想占领美丽的地球，但是被努努多一家的善良快乐所感动，并且被地球的美景和妈妈料理的美食吸引，于是决定定居在地球上。由于生活习惯和地球人不一样，唧唧、歪歪、小闹闹每天都会闹出一些笑话。芒果镇上因为多了这三个外星活宝，每天笑声不断！<br />','1','','0','','1','/dpic/20120725/298.jpg','478','/donghuapian/478/1.html, /donghuapian/478/2.html, /donghuapian/478/3.html, /donghuapian/478/4.html, /donghuapian/478/5.html, /donghuapian/478/6.html, /donghuapian/478/7.html, /donghuapian/478/8.html, /donghuapian/478/9.html, /donghuapian/478/10.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/05/0121.jpg','http://www.61baobao.com/donghuapian/pic/05/0121.jpg','0','三个月以上','10','cntv,3E89AFEEFC244d71919EB612B4BC0F10|||cntv,400E009662DA42b4A39B266E4411C903|||cntv,493A6716F1384b73BA167E65F45DD6C2|||cntv,FE8B61E6C669427b9D3012EE8C0EC426|||cntv,54FF5DB647C74b8b9D708D9ED2F54C34|||cntv,A9FB3EAB915940ff89831877D1D7F68B|||cntv,6343F567231343f187F64B8493F6D86C|||cntv,1188CAB6232743e09ED0BBEDBCFE8C2F|||cntv,8E5778F947074200B0C35C456D611F21|||cntv,4E689943AE494d6c8C028E13F686EC4D|||','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('662','5','0','','','','1','admin','','1','0','1343189405','0','0','0','2','','','662','0','0','0','0','0','0','傻瓜猫','1343189405','/spic/20120725/307.jpg','0','1','1343189405','0','3','1','0','','0','','','667','479','傻瓜猫讲述的是大约在150年前的中国，有一只活力十足的小猫仔SAGWA。在猫家族中，SAGWA还有一个哥哥冬瓜和妹妹西瓜。三只小猫跟着他们的爸爸妈妈、爷爷奶奶居住在县太爷的衙门里。猫家族有自己的看家本领书法。他们为县太爷撰写各种法令条例。和他们生活在一起的还有县太爷的太太、三个可爱的女儿、师爷、厨师，以及那种聪明的蝙蝠福蝠。小猫们在他们成长中，经历着各种各样的事情；好奇心极强的他们，总是状况百出。福也好祸也罢，都使它们的成长之路充满了冒险的色彩。','1','','0','','1','/dpic/20120725/308.jpg','361','/donghuapian/361/1.html, /donghuapian/361/2.html, /donghuapian/361/3.html, /donghuapian/361/4.html, /donghuapian/361/5.html, /donghuapian/361/6.html, /donghuapian/361/7.html, /donghuapian/361/8.html, /donghuapian/361/9.html, /donghuapian/361/10.html, /donghuapian/361/11.html, /donghuapian/361/12.html, /donghuapian/361/13.html, /donghuapian/361/14.html, /donghuapian/361/15.html, /donghuapian/361/16.html, /donghuapian/361/17.html, /donghuapian/361/18.html, /donghuapian/361/19.html, /donghuapian/361/20.html, /donghuapian/361/21.html, /donghuapian/361/22.html, /donghuapian/361/23.html, /donghuapian/361/24.html, /donghuapian/361/25.html, /donghuapian/361/26.html, /donghuapian/361/27.html, /donghuapian/361/28.html, /donghuapian/361/29.html, /donghuapian/361/30.html, /donghuapian/361/31.html, /donghuapian/361/32.html, /donghuapian/361/33.html, /donghuapian/361/34.html, /donghuapian/361/35.html, /donghuapian/361/36.html, /donghuapian/361/37.html, /donghuapian/361/38.html, /donghuapian/361/39.html, /donghuapian/361/40.html, /donghuapian/361/41.html, /donghuapian/361/42.html, /donghuapian/361/43.html, /donghuapian/361/44.html, /donghuapian/361/45.html, /donghuapian/361/46.html, /donghuapian/361/47.html, /donghuapian/361/48.html, /donghuapian/361/49.html, /donghuapian/361/50.html, /donghuapian/361/51.html, /donghuapian/361/52.html, /donghuapian/361/53.html, /donghuapian/361/54.html, /donghuapian/361/55.html, /donghuapian/361/56.html, /donghuapian/36