E_D("replace into `phome_ecms_game` values('698','5','0','','','','1','admin','','1','0','1343189504','0','0','0','0','','','698','0','0','0','0','0','0','小虫虫有大智慧','1343189504','/spic/20120725/368.jpg','0','1','1343189504','0','3','1','0','','0','','','667','479','《小虫虫有大智慧》全剧讲的是讲述虫虫村里一群可爱的小虫子：小蜜蜂多多蜜、蝴蝶小甜甜、粪金龟铁头、蜘蛛八脚婆婆、萤火虫兄弟亮亮和闪闪以及一只生活在水洼里的蟾蜍大嘴蛙和他的跟班苍蝇铁头，他们之间充满知识性和趣味性的故事。小小的虫虫村每天都会发生一些有趣的事情：铁盒突然变轻了；虫虫村突然多了无数个陷阱；铁头的家变成了空中的楼阁；虫虫们一起去寻找海潮声；虫虫村装上了简易的电话，尝试做出最牢固的门等等。虫虫村经常也会有一些不速之客来到这里，比如形如棍子的竹节虫；神奇的小魔豆；调皮的蝼蛄；视力很差却能够通过身体发出信号的活雷达蝙蝠；可以整天不睡觉的壁虎；只能跳着走不会直立行走的麻雀等等。虫虫们的生活就是这样多姿多彩！本片寓教于乐，通过童趣的故事、搞笑的情节，生动形象地向小观众们介绍了大自然中奇特的昆虫、植物以及生活中常见的科学小知识，是一部突破传统的幼儿科普动画片。','1','','0','','1','/dpic/20120725/369.jpg','275','/donghuapian/275/1.html, /donghuapian/275/2.html, /donghuapian/275/3.html, /donghuapian/275/4.html, /donghuapian/275/5.html, /donghuapian/275/6.html, /donghuapian/275/7.html, /donghuapian/275/8.html, /donghuapian/275/9.html, /donghuapian/275/10.html, /donghuapian/275/11.html, /donghuapian/275/12.html, /donghuapian/275/13.html, /donghuapian/275/14.html, /donghuapian/275/15.html, /donghuapian/275/16.html, /donghuapian/275/17.html, /donghuapian/275/18.html, /donghuapian/275/19.html, /donghuapian/275/20.html, /donghuapian/275/21.html, /donghuapian/275/22.html, /donghuapian/275/23.html, /donghuapian/275/24.html, /donghuapian/275/25.html, /donghuapian/275/26.html, /donghuapian/275/27.html, /donghuapian/275/28.html, /donghuapian/275/29.html, /donghuapian/275/30.html, /donghuapian/275/31.html, /donghuapian/275/32.html, /donghuapian/275/33.html, /donghuapian/275/34.html, /donghuapian/275/35.html, /donghuapian/275/36.html, /donghuapian/275/37.html, /donghuapian/275/38.html, /donghuapian/275/39.html, /donghuapian/275/40.html, /donghuapian/275/41.html, /donghuapian/275/42.html, /donghuapian/275/43.html, /donghuapian/275/44.html, /donghuapian/275/45.html, /donghuapian/275/46.html, /donghuapian/275/47.html, /donghuapian/275/48.html, /donghuapian/275/49.html, /donghuapian/275/50.html, /donghuapi